import React from 'react';
import {Route} from 'react-router-dom';
import Home from './pages/Home';
import Bottoms from './Bottom/Bottoms';



const App = () => {
  return (

    <>
    <Bottom />
    <Route component={Home} path ="/Home" />

    <br /><br /><br /><br /><br /><br /><br /><br /><br /><br /><br /><br /><br /><br /><br />
    <br /><br /><br /><br /><br /><br /><br /><br /><br /><br /><br /><br /><br /><br /><br />
    <br /><br /><br /><br /><br /><br />

<Bottom />
</>

  );
};

export default App;
